import React from "react";
import { Link } from "react-router-dom";
import './startbutton.css';


const StartButton=()=>{
    return(
        <StartButtonStyled>

        
        <div className="StartButton">
            <Link to="/write"><button className="StartButton">시작하기</button></Link>
        </div>
        </StartButtonStyled>
    )
}

export default StartButton;
